class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        if not nums:
            return []
        count = 0
        candidate = None
        for num in nums:
            if count == 0:
                candidate = num
            count += (1 if num == candidate else -1)
        count = 0
        result = []
        for num in nums:
            if num == candidate:
                count += 1
            else:
                if count > 0:
                    count -= 1
                else:
                    result.append(candidate)
                    count = 1
                    candidate = num
        return result

