    def dfs(node, par):
        dp = [[0, 0] for _ in range(n)]
        dp[0][0] = x[0]
        dp[0][1] = 1
        stack = [node]
        visited = set([node])
        while stack:
            node = stack.pop()
            for i in graph[node]:
                if i != par:
                    if len(graph[i]) == 1:
                        if visited[i] == {i}:
                            stack.append(i)
                            visited.add(i)
                    else:
