class Solution:
    def merge(self, intervals):
        """
        :type intervals: List[List[int]]
        :rtype: List[List[int]]
        """
        if not intervals:
            return []
        intervals.append((float('inf'), float('inf'), float('inf')))
        res = [intervals[0]]
        for i in range(1, len(intervals)):
            if intervals[i][0] <= res[-1][2]:
                res[-1] = (res[-1][0], max(res[-1][1], intervals[i][1]), res[-1][2])
            else:
                res.append(intervals[i])
        return res

